import{_ as a,o as t,c as o,O as i}from"./chunks/framework.a4daa24a.js";const f=JSON.parse('{"title":"Things To Know Before You Start","description":"","frontmatter":{},"headers":[],"relativePath":"getting_started/things_to_know.md","filePath":"getting_started/things_to_know.md","lastUpdated":1700510338000}'),r={name:"getting_started/things_to_know.md"};function n(s,e,l,u,d,h){return t(),o("div",null,e[0]||(e[0]=[i('<h1 class="text-[var(--font-accent)]" id="things-to-know-before-you-start" tabindex="-1">Things To Know Before You Start <a class="header-anchor" href="#things-to-know-before-you-start" aria-label="Permalink to &quot;Things To Know Before You Start {.text-[var(--font-accent)]}&quot;">​</a></h1><h2 id="this-page-is-an-overview-of-things-to-know-and-understand-before-you-start-this-project" tabindex="-1">This page is an overview of things to know and understand before you start this project <a class="header-anchor" href="#this-page-is-an-overview-of-things-to-know-and-understand-before-you-start-this-project" aria-label="Permalink to &quot;This page is an overview of things to know and understand before you start this project&quot;">​</a></h2><h3 id="software-is-not-final" tabindex="-1">Software is not final <a class="header-anchor" href="#software-is-not-final" aria-label="Permalink to &quot;Software is not final&quot;">​</a></h3><p>Bugs can and will occur which may hinder the experience or usability at times. Do not expect 100% reliable and perfect function. Not all features are fully developed yet.</p><h3 id="firmware-may-have-user-difficulties" tabindex="-1">Firmware may have user difficulties <a class="header-anchor" href="#firmware-may-have-user-difficulties" aria-label="Permalink to &quot;Firmware may have user difficulties&quot;">​</a></h3><p>Our firmware has not been tested widely so issues may creep up.</p><h3 id="ir-emitters-are-dangerous" tabindex="-1">IR emitters are dangerous <a class="header-anchor" href="#ir-emitters-are-dangerous" aria-label="Permalink to &quot;IR emitters are dangerous&quot;">​</a></h3><p>If handled wrong or precautions are ignored you can and will cause damage to your eyes. Please make sure to only buy linked ones or ones with specs that match exactly. We will not be responsible for damage caused if you go your own route.</p><h3 id="documentation-may-be-incomplete" tabindex="-1">Documentation may be incomplete <a class="header-anchor" href="#documentation-may-be-incomplete" aria-label="Permalink to &quot;Documentation may be incomplete&quot;">​</a></h3><p>Important steps may be missing.</p><h3 id="you-will-need-to-set-up-your-avatar-to-use-this" tabindex="-1">You will need to set up your avatar to use this <a class="header-anchor" href="#you-will-need-to-set-up-your-avatar-to-use-this" aria-label="Permalink to &quot;You will need to set up your avatar to use this&quot;">​</a></h3><p>This will require basic knowledge of Unity and ownership of your own avatar. Note: The 2.0 beta version of our app uses VRC&#39;s Native eye tracking, which does <strong>NOT</strong> require a special avatar.</p><h3 id="once-you-have-acknowledged-the-items-above-move-on-to-the-full-build-guide" tabindex="-1">Once you have acknowledged the items above, move on to the <a href="./../how_to_build/full_build">Full Build Guide</a> <a class="header-anchor" href="#once-you-have-acknowledged-the-items-above-move-on-to-the-full-build-guide" aria-label="Permalink to &quot;Once you have acknowledged the items above, move on to the [Full Build Guide](../how_to_build/full_build)&quot;">​</a></h3>',13)]))}const m=a(r,[["render",n]]);export{f as __pageData,m as default};
